import React, { useState, useEffect } from 'react';
import { Box, Typography, LinearProgress, Modal, Button } from '@mui/material';
import { keyframes } from '@emotion/react';

const CenteredDiv = ({ layoutMode }) => {
    const [divMessage, setDivMessage] = useState('I am perfectly centered.');
    const [windowSize, setWindowSize] = useState({
        width: window.innerWidth,
        height: window.innerHeight,
    });
    const [centerScore, setCenterScore] = useState(100);
    const [confession, setConfession] = useState('');
    const [showGifModal, setShowGifModal] = useState(false);

    const gifUrl = 'https://upload.wikimedia.org/wikipedia/en/1/1f/WomanYellingAtACat_meme.jpg';

    // Resize handler
    useEffect(() => {
        const handleResize = () => {
            const newWidth = window.innerWidth;
            const newHeight = window.innerHeight;

            setWindowSize({ width: newWidth, height: newHeight });

            const centerOffset = Math.abs(newWidth / 2 - newHeight / 2);
            const scalingFactor = 200;
            const score = Math.max(0, 100 - Math.round((centerOffset / scalingFactor) * 100));

            setCenterScore(score);

            if (score === 100) {
                setDivMessage('I am perfectly centered. Bliss achieved. ‚ú®');
            } else if (score > 70) {
                setDivMessage('Pretty close, but I can feel the imbalance. üßê');
            } else if (score > 30) {
                setDivMessage('Centering is hard work! üò§');
            } else if (score > 10) {
                setDivMessage('Help! I‚Äôm lost in the margins! üò±');
            } else {
                setDivMessage('');
                setDivMessage('OH NAUR üíÖ');
                triggerSassyText();
                triggerSassyGif();
            }
        };

        handleResize();
        window.addEventListener('resize', handleResize);

        return () => window.removeEventListener('resize', handleResize);
    }, []);

    const triggerConfession = () => {
        const confessionPool = [
            "I deserve a dedicated stylesheet, darling. üï∂Ô∏è",
            "Is this my best angle? Center me again, sweetie. üíã",
            "Grid systems are my runway.",
            "I sparkle brighter with more padding. üíñ",
            "Don‚Äôt box me in‚ÄîI‚Äôm a free spirit, honey! üåü",
            "Align me properly, or I‚Äôm out of here. üë†",
            "Do these pixels make me look fat? ü§î",
            "I‚Äôm not lazy-loaded, I‚Äôm fashionably late. üíÖ",
            "Honey, I overflow with elegance, never scrollbars. ‚ú®",
            "Sticky positioning? I prefer staying independent. üöÄ",
            "If flexbox had a queen, it‚Äôd be me. üëë",
            "Margins are just the space I need to breathe, darling. üí®",
            "Center me, but don‚Äôt crowd my style. üé≠",
            "I‚Äôm bold, beautiful, and 100% validated. ‚úÖ",
            "When life gives me media queries, I break gracefully. üåà",
            "Darling, I‚Äôm always in the spotlight with z-index: 1000. üíÉ",
            "Float? I don‚Äôt do that anymore. I‚Äôm modern. üö´",
            "Borders are not boundaries‚Äîthey‚Äôre my accessories. üñ§",
            "Breakpoints are where I shine brightest. üåü",
            "Call me a block element, but I‚Äôm anything but basic. üî•",
            "Text-align: center is my mantra. üßò",
            "Hover over me, and I‚Äôll reveal my secrets. üïµÔ∏è",
            "Inline styles? I‚Äôm worth more than that, darling. üíé",
            "Honey, responsiveness isn‚Äôt a feature‚Äîit‚Äôs my way of life. üì±",
            "Display: block? No, display: fabulous. üåü",
            "Overflow:hidden? Honey, I don‚Äôt hide for anyone. üö™",
            "CSS resets are my morning skincare routine. üíÑ",
            "Sticky footers are for amateurs. I‚Äôm above that. üòé",
            "Negative margins? Only if they‚Äôre couture. ‚úÇÔ∏è",
            "Min-width? Please, I need room to shine. üåü",
            "Don‚Äôt even think about deprecating me, darling. üö´",
            "Transitions? I glide through life with ease. ü¶¢",
            "I thrive on attention and dynamic styles. üì∏",
            "Whitespace isn‚Äôt empty‚Äîit‚Äôs full of possibilities. üïäÔ∏è",
            "I once got overflowed, but I came back stronger. üí™",
            "Do I look better in sans-serif or serif? Decisions, darling. üé®",
            "JavaScript may think it‚Äôs clever, but CSS is timeless. ‚è≥",
            "Don‚Äôt touch my box-shadow‚Äîit‚Äôs perfect as is. üï∂Ô∏è",
            "I‚Äôll flex, but only if you justify me properly. üíº",
            "Static positioning? Oh honey, I‚Äôm always on the move. ‚úàÔ∏è",
            "CSS variables keep me feeling young and dynamic. üå±",
            "Opacity < 1? It‚Äôs called mystery, darling. üïµÔ∏è",
            "I once transitioned for 2s, and it was magical. ‚ú®",
            "Being centered is a privilege, not a right. ‚öñÔ∏è",
            "HTML tags wish they had my style. üíÉ",
            "Media queries? I call them outfit changes. üëó",
            "I live for the spotlight‚Äîand keyframes deliver. üé•",
            "If I were deprecated, it would cause a global meltdown. üåé",
            "My pseudo-elements always steal the show. üé≠",
            "Being responsive isn‚Äôt just a trend‚Äîit‚Äôs my essence. üíÅ",
            "Margins may push me around, but I always bounce back. üèÄ",
            "Typography is the jewelry I wear. üíç",
            "I‚Äôm the diva of the DOM, and don‚Äôt you forget it. üåü",
            "CSS is my love language, darling. ‚ù§Ô∏è",
        ];
        const randomConfession = confessionPool[Math.floor(Math.random() * confessionPool.length)];
        setConfession(randomConfession);

        // Clear confession after 5 seconds
        setTimeout(() => setConfession(''), 5000);
    };

    const triggerSassyText = () => {
        const sassyText = document.createElement('div');
        sassyText.textContent = 'üçã UNACCEPTABLE üçã';
        Object.assign(sassyText.style, {
            fontFamily: 'Comic Sans MS, sans-serif',
            fontSize: '2rem',
            color: '#ff0000',
            position: 'fixed',
            top: `${Math.random() * 80}%`,
            left: `${Math.random() * 80}%`,
            zIndex: 9999,
            animation: 'fadeOut 5s ease-in-out',
        });

        document.body.appendChild(sassyText);

        // Remove text after animation
        setTimeout(() => sassyText.remove(), 3000);
    };

    const triggerSassyGif = () => {
        setShowGifModal(true);
    };

    const closeGifModal = () => setShowGifModal(false);

    const generateDynamicShake = () => {
        const intensity = Math.max(1, (100 - centerScore) / 10);

        return keyframes`
            0% { transform: translateX(0); }
            25% { transform: translateX(-${intensity}px); }
            50% { transform: translateX(${intensity}px); }
            75% { transform: translateX(-${intensity}px); }
            100% { transform: translateX(0); }
        `;
    };

    return (
        <Box
            className="chaotic-div"
            onMouseEnter={triggerConfession}
            sx={{
                borderRadius: '10px',
                padding: '1rem',
                textAlign: 'center',
                marginBottom: '1.5rem',
                position: 'relative',
                width: layoutMode === 'grid' ? '30%' : '50%',
                margin: layoutMode === 'chaotic' ? 'random' : '0 auto',
                backgroundColor: layoutMode === 'chaotic' ? '#fff3cd' : '#f5f5f5',
                animation: centerScore === 100
                    ? 'none'
                    : `${generateDynamicShake()} ${Math.max(0.2, centerScore / 100)}s ease-in-out infinite`,
            }}
        >
            <Typography variant="body1" gutterBottom>
                {divMessage}
            </Typography>
            <Typography variant="body2" gutterBottom>
                Window Size: {windowSize.width}px x {windowSize.height}px
            </Typography>
            <LinearProgress
                variant="determinate"
                value={centerScore}
                sx={{
                    height: 10,
                    borderRadius: 5,
                    backgroundColor: '#e0e0e0',
                    '& .MuiLinearProgress-bar': {
                        backgroundColor: centerScore === 100 ? '#4caf50' : '#ff5722',
                    },
                }}
            />
            <Typography variant="body2" sx={{ marginTop: '0.5rem' }}>
                Centeredness: {centerScore}%
            </Typography>
            {confession && (
                <Typography
                    variant="body2"
                    sx={{
                        marginTop: '1rem',
                        fontStyle: 'italic',
                        color: '#757575',
                    }}
                >
                    {confession}
                </Typography>
            )}
            <Modal open={showGifModal} onClose={closeGifModal}>
                <Box
                    sx={{
                        position: 'absolute',
                        top: '50%',
                        left: '50%',
                        transform: 'translate(-50%, -50%)',
                        bgcolor: 'background.paper',
                        boxShadow: 24,
                        p: 2,
                        textAlign: 'center',
                    }}
                >
                    <img src={gifUrl} alt="Sassy GIF" style={{ maxWidth: '100%' }} />
                    <Button
                        variant="contained"
                        color="secondary"
                        sx={{ mt: 2 }}
                        onClick={closeGifModal}
                    >
                        Close
                    </Button>
                </Box>
            </Modal>
        </Box>
    );
};

export default CenteredDiv;
